    "2073": {
        "subject": "resource/Mi_Fu",
        "predicate": "ontology/abstract",
        "object": "Mi Fu (Chinese: \u7c73\u82be or \u7c73\u9efb; pinyin: M\u01d0 F\u00fa, 1051\u20131107) was a Chinese painter, poet, and calligrapher born in Taiyuan during the Song Dynasty. In painting he gained renown for his style of painting misty landscapes. This style would be deemed the \"Mi Fu\" style and involved the use of large wet dots of ink applied with a flat brush. His poetry followed the style of Li Bai and his calligraphy that of Wang Xizhi. His uninhibited style made him disliked at the Song court.He is best known for his calligraphy, and he was regarded as one of the four greatest calligraphers of the Song Dynasty.  His style arises from that of calligraphers in earlier dynasties, but with a unique mark of his own.As a personality Mi Fu was noted as an eccentric. At times they even deemed him \"Madman Mi\" because he was obsessed with collecting stones and even declared one stone to be his brother. Hence he would bow to his \"brother\" rock in a display of the filial devotion given to older brothers. He also was known as a heavy drinker. His son, Mi Youren, would also be a famous painter in his father's artistic style. Unlike his father Mi Youren lived to be quite elderly, dying at the age of 79."
    },
