    "3403": {
        "subject": "resource/Court_of_Assistants",
        "predicate": "ontology/abstract",
        "object": "A Court of Assistants is a council of members belonging to professional, trade, craft or livery organisations. The term originated among the London Livery Companies, but may also be used by other trade associations. The Court of Assistants is usually the governing body of these organisations and may include the officials, as in the case of the Worshipful Company of Clockmakers founded in 1631: \"The governing body of the Company is the Court of Assistants, comprising the Master, three Wardens and not less than ten Assistants.\" Another example is the Honourable Artillery Company which has an Annual General Court open to all members. It meets in March to elect 20 Assistants. The Company is governed in its civil and financial affairs by the Court of Assistants, which was first established in 1633."
    },
