        "predicate": "http://www.w3.org/2000/01/rdf-schema#comment",
        "object": "Offenbach am Main (German pronunciation: [\u02c8\u0254f\u0259nba\u03c7 am \u02c8ma\u026a\u032fn]) is a city in Hesse, Germany, located on the southside of the river Main and part of the Frankfurt Rhein-Main urban area. Offenbach has a population of 126,934.In the twentieth century the city's economy was dominated by the machine-building and leather industries, and it was also a major centre of the typography and design industries. Other important industries are the automobile and pharmaceutical industries."
