    "4543": {
        "subject": "resource/Benjamin_Tupper",
        "predicate": "ontology/abstract",
        "object": "Benjamin Tupper (March 11, 1738 \u2013 June 16, 1792) was a soldier in the French and Indian War, and an officer of the Continental Army during the American Revolutionary War, achieving the rank of brevet brigadier general. Subsequently, he served as a Massachusetts legislator, and he assisted Gen. William Shepard in stopping Shays' Rebellion. Benjamin Tupper was a co-founder of the Ohio Company of Associates, and was a pioneer to the Ohio Country, involved in establishing Marietta, Ohio as the first permanent settlement in the Northwest Territory."
    },
