        "object": "Johann Karl Burckhardt (30 April 1773 \u2013 22 June 1825) was a German-born astronomer and mathematician who later became a naturalized French citizen. (He later became known as Jean Charles Burckhardt -- as in the engraved portrait shown here).  He is remembered in particular for his work in fundamental astronomy, and for his lunar theory, which was in widespread use for the construction of navigational ephemerides of the Moon for much of the first half of the nineteenth century."
