    "5770": {
        "subject": "resource/Ramprasad_Sen",
        "predicate": "ontology/abstract",
        "object": "Sadhak R\u0101mpras\u0101d Sen (Bengali: \u09b0\u09be\u09ae\u09aa\u09cd\u09b0\u09b8\u09be\u09a6 \u09b8\u09c7\u09a8; c. 1718 or c. 1723 \u2013 c. 1775) was a Shakta poet and saint of eighteenth century Bengal. His bhakti poems, known as Ramprasadi, are still popular in Bengal\u2014they are usually addressed to the Hindu goddess Kali and written in Bengali. Stories of Ramprasad's life typically include legends and myths mixed with biographical details.It is said that, Ramprasad was born into a Tantric family, and showed an inclination towards poetry from an early age. He became a disciple of Krishnananda Agamavagisha, a Tantric scholar and yogi. Ramprasad became well known for his devotional songs, eventually becoming the court poet for the king Krishna Chandra of Nadia. His life has been the subject of many stories depicting his devotion to, and relationship with, Kali. Ramprasad's literary works include Vidyasundar, Kali-kirtana, Krishna-kirtana and Shaktigiti.Ramprasad is credited with creating a new compositional form that combined the Bengali folk style of Baul music with classical melodies and kirtan. The new style took root in Bengali culture with many poet-composers combining folk and raga-based melodies, mixing every common style of music from classical to semi-classical and folk. His songs are sung today, with a popular collection\u2014Ramprasadi Sangit (\"Songs of Ramprasad\")\u2014sold at Shakta temples and pithas in Bengal."
    },
