    "6573": {
        "subject": "resource/The_Messengers_(film)",
        "predicate": "ontology/abstract",
        "object": "The Messengers is a 2007 American supernatural horror film directed by the Pang Brothers, and produced by Sam Raimi. It stars Kristen Stewart, John Corbett, William B. Davis, Dylan McDermott, and Penelope Ann Miller. The film is about an ominous darkness that invades a seemingly serene sunflower farm in North Dakota, and the Solomon family\u2014the owners of the farm\u2014who are torn apart by suspicion, mayhem, and murder.The film was released on February 2, with the DVD released on June 5. Filming took place in the Qu'Appelle Valley near the small community of Abernethy, Saskatchewan, Canada. The graphic novel adaptation was published in January 2007 by Dark Horse Comics, written by Jason Hall, and illustrated by Kelley Jones. The prequel, Messengers 2: The Scarecrow, was released on June 21, 2009."
    },
