    "6978": {
        "subject": "resource/Her_Grace_Commands",
        "predicate": "ontology/abstract",
        "object": "Her Grace Commands (German: Ihre Hoheit befiehlt) is a 1931 German romantic comedy film directed by Hanns Schwarz and starring K\u00e4the von Nagy, Willy Fritsch and Reinhold Sch\u00fcnzel. It is also translated into the alternative title Her Highness Commands. A hairdresser and a greengrocer fall in love, concealing from each other the truth that they are really a Princess and an army officer in disguise. It premiered in Mannheim on 3 March 1931. A French-language version Princesse, \u00e0 vos ordres! was made simultaneously, also directed by Schwarz but with a different cast. The film was later remade in Hollywood by the Fox Film Corporation as Adorable."
    },
    "6977": {
        "subject": "resource/John_and_Mary_(film)",
        "predicate": "ontology/abstract",
        "object": "John and Mary is a 1969 American romantic drama film directed by Peter Yates. It stars Dustin Hoffman and Mia Farrow in the title roles, directly on the heels of Midnight Cowboy and Rosemary's Baby, respectively (as well as Bullitt for Yates). The screenplay was adapted by John Mortimer from the Mervyn Jones novel.It was released theatrically in North America on December 14, 1969. It received an R rating upon its original release, which was later downgraded to a PG rating."
    },
