    "7746": {
        "subject": "resource/Abraham_Kuyper",
        "predicate": "ontology/abstract",
        "object": "Abraham Kuijper /\u02c8ka\u026ap\u0259r/ (Dutch pronunciation: [\u02c8a\u02d0bra\u02d0\u0266\u0251m \u02c8k\u0153yp\u0259r]; 29 October 1837 \u2013 8 November 1920), generally known as Abraham Kuyper, was a Dutch journalist, statesman and Neo-Calvinist theologian. He was a master organiser.  He founded a new church (the Gereformeerde Kerken), a newspaper, the Free University of Amsterdam, and the Anti-Revolutionary Party. He served as Prime Minister of the Netherlands between 1901 and 1905.  In religious affairs, he sought to adapt the Dutch Reformed Church to the challenges posed by the loss of state financial and aid, by religious pluralism, rising nationalism, and the Arminian religious revivals of his day which denied predestination. He vigorously denounced modernism in theology as a fad that would pass away.  In politics, he dominated the Anti-Revolutionary Party (ARP) from its founding 1879 to his death in 1920. He  promoted pillarisation, the social expression of the anti-thesis in public life, whereby Protestant, Catholic and secular elements each had their own independent schools, universities and social organisations."
    },
