        "predicate": "http://www.w3.org/2000/01/rdf-schema#comment",
        "object": "Niger (/\u02c8na\u026ad\u0292\u0259r/ or /ni\u02d0\u02c8\u0292\u025b\u0259r/; French: [ni\u0292\u025b\u0281]), officially the Republic of Niger, is a landlocked country in Western Africa, named after the Niger River. Niger covers a land area of almost 1,270,000 km2, making it the largest nation in West Africa, with over 80 percent of its land area covered by the Sahara Desert. The country's predominantly Islamic population of 17,138,707 is mostly clustered in the far south and west of the nation."
