    "7953": {
        "subject": "resource/Butterfly_(Hartnett_novel)",
        "predicate": "ontology/abstract",
        "object": "Butterfly  is a 2009 young adult fiction novel by Sonya Hartnett about the troubled adolescence of Plum Coyle, set in 1980s Australian suburbia. The Blurb is; Plum Coyle is on the edge of adolescence. Her fourteenth birthday is approaching, when her old life and her old body will fall away, and she will become graceful, powerful, and at ease. The strength of the objects she stores in a briefcase under her bed \u2014a crystal lamb, a yoyo, an antique watch, a coin \u2014will make sure of it. Over the next couple of weeks, Plum\u2019s life will change. Her beautiful neighbor Maureen will begin to show Plum how she might fly. The older brothers she adores will court catastrophe in worlds that she barely knows exist. And her friends, her worst enemies, will tease and test, smelling weakness. They will try to lead her on and take her down"
    },
