    "5095": {
        "subject": "resource/Th\u00e9ophile_Gautier",
        "predicate": "ontology/abstract",
        "object": "Pierre Jules Th\u00e9ophile Gautier (French: [pj\u025b\u0281 \u0292yl teofil \u0261otje]; 30 August 1811 \u2013 23 October 1872) was a French poet, dramatist, novelist, journalist, and art and literary critic.While Gautier was an ardent defender of Romanticism, his work is difficult to classify and remains a point of reference for many subsequent literary traditions such as Parnassianism, Symbolism, Decadence and Modernism. He was widely esteemed by writers as diverse as Balzac, Baudelaire, the Goncourt brothers, Flaubert, Ezra Pound, T. S. Eliot, Henry James, Proust and Oscar Wilde."
    },
